人気のごま麦茶に黒の力をプラス！！胡麻麦茶（ごま麦茶）はゴマリグナンや黒い色素アントシアニンを含む黒胡麻に香り高い麦茶やはと麦をブレンドした健康志向のおいしいお茶です。健康と美容に関心のある方におすすめしたいお茶です。「黒胡麻麦茶」は、香り高い麦茶にゴマリグナンを含む黒胡麻、大麦、はと麦、大豆などをブレンドした健康茶です。ゴマ麦茶はリグナン類が含まれる黒胡麻と、黒い色素アントシアニンを含んだ、苦味・渋みがなくスッキリした香りのお茶です。【名称】黒胡麻麦茶<br>【内容量】90g（3g×30袋） <br>【原材料】大麦、はと麦、大豆、黒胡麻 <br>【販売元】ミナミヘルシーフーズ<br>【お召し上がり方】<br> マグカップ・急須の場合<br>ティーバック1袋を入れてお飲みいただく量のお湯を注いで、適宜な色、香りが出ましたらお召し上がりください。<br>やかんで煮出す場合<br>熱湯約600mlの中へティーバック1袋を入れ、弱火で3～5分煮出してください。<br>夏場には、冷蔵庫で冷やしていただきますと一層おいしくお飲みいただけます。<br>濃い目をお好みの方はゆっくり、薄めをお好みの方は早めに湯飲みへきゅう湯してください。 <br><br>胡麻麦茶（ごま麦茶）はゴマリグナンや黒い色素アントシアニンを含む黒胡麻に香り高い麦茶やはと麦をブレンドした健康志向のおいしいお茶です。健康と美容に関心のある方におすすめしたいお茶です。「黒胡麻麦茶」は、香り高い麦茶にゴマリグナンを含む黒胡麻、大麦、はと麦、大豆などをブレンドした健康茶です。ゴマ麦茶はリグナン類が含まれる黒胡麻と、黒い色素アントシアニンを含んだ、苦味・渋みがなくスッキリした香りのお茶です。<br>■90g（3g×30袋）<br>■納期：<br>※表記上の納期は、通常お届けとなります。<br>人気商品など変動の多い商品もございますので、<br>表記は目安としてご参考くださいますようお願い申し上げます。<br>区分：健康食品<br><br>広告文責：株式会社ノースウェブ　Tel 0144-52-0018<br><div id="migi-obi">

