まだ高いペットボトルをお飲みですか？黒ごま調合ごま健康麦茶は、精選された大麦をじっくり麦の芯まで焙煎した香り豊かな麦茶に、焙煎黒ゴマの成分が抽出しやすいように挽き割り加工を施して調合しました。それに、黒豆とはと麦を調合しました。また、本品１袋（１２．５）当たり、黒ゴマを約４００粒入れております。ゴマの代表的な成分としては、種子から油を搾り取ったカスの中に、リグナンといわれる水溶性の成分があります。理想的使用量は１人当たり１日２袋を目安に。特にスタイリストを心がける方におすすめいたします。<BR><BR><div align='center'><IMG src=https://image.rakuten.co.jp/dietshop/cabinet/image200/gomakenko-01.gif><BR></div><BR>［名　　称］混合麦茶<br>［原材料名］大麦、黒ゴマ、黒豆（非遺伝組み換え大豆）、はと麦<br>［内容量］200ｇ（12.5ｇ×16袋）　12個セット<br>［召し上がり方］<br>１．水を約１分間沸騰させて下さい。（カルキが逃げます）<br>２．バッグを入れて下さい。<br>（１）沸騰を続ける程度に火力を調節し３～５分してバッグを取り出して下さい。<br>（２）バッグを入れてすぐ火を止める場合１～２時間してバッグを取り出して下さい。<br>３．できるだけ早く荒らさましして下さい。<br>［販売元］株式会社小谷穀粉<br>［使用上の注意］<br>・バックを入れたまま、あまり長く沸騰させますと麦茶の良い香りが逃げます。<br>・開封後は商品の劣化や異物の混入を防ぐため、開封口を閉めるか、茶缶等に入れて保存し、お早めにお召し上がり下さい。<br>［保存上の注意］直射日光、高温多湿を避けて冷暗所で保存して下さい。<br>・栄養成分表示：１００ｍｌ中<br>エネルギー３．６ｋｃａｌ無水カフェイン０ｇ<br>たんぱく質０ｇタンニン０．０１ｇ<br>脂　質０ｇ<br>炭水化物０．９ｇ<br>ナトリウム０ｍｇ

<br>※通常3日～6日前後で配送の予定ですが、人気商品の為、商品欠品の場合、それよりもお時間をいただくことがございます。ご了承くださいませ。<br><br>区分：健康食品<br><br>広告文責：株式会社ノースウェブ　Tel 0144-52-0018<br><div id="migi-obi">

